import React, { useContext, useState } from "react";
import { UserContext } from "../components/UserContext";
import { Container, Row, Col, Form } from "react-bootstrap";
import UserCard from "../components/UserCard";

const WszystkieOgloszenia = () => {
  const { users } = useContext(UserContext);
  const [filteredUsers, setFilteredUsers] = useState(users);
  const [miastoFilter, setMiastoFilter] = useState("");
  const [kategoriaFilter, setKategoriaFilter] = useState("");

  // Funkcja do filtrowania użytkowników na podstawie miasta i kategorii
  const filterUsers = () => {
    let filtered = users;

    // Filtrowanie po mieście
    if (miastoFilter !== "") {
      filtered = filtered.filter((user) => user.miasto.toLowerCase() === miastoFilter.toLowerCase());
    }

    // Filtrowanie po kategorii
    if (kategoriaFilter !== "") {
      filtered = filtered.filter((user) => user.kategoria.toLowerCase() === kategoriaFilter.toLowerCase());
    }

    setFilteredUsers(filtered);
  };  

  // Resetowanie filtrów
  const resetFilters = () => {
    setMiastoFilter("");
    setKategoriaFilter("");
    setFilteredUsers(users);
  };

  return (
    <Container style={{ background: "#111111", padding: "20px" }}>
      <h2>Wszystkie Ogłoszenia</h2>
      <Form.Row className="mb-3">
        <Form.Group as={Col} md="4">
          <Form.Label>Miasto:</Form.Label>
          <Form.Control
            as="select"
            value={miastoFilter}
            onChange={(e) => setMiastoFilter(e.target.value)}
          >
            <option value="">--- Wybierz miasto ---</option>
            <option value="warszawa">Warszawa</option>
            <option value="krakow">Kraków</option>
            <option value="gdansk">Gdańsk</option>
            <option value="wroclaw">Wrocław</option>
            <option value="poznan">Poznań</option>
            <option value="rzeszow">Rzeszów</option>
          </Form.Control>
        </Form.Group>
        <Form.Group as={Col} md="4">
          <Form.Label>Kategoria:</Form.Label>
          <Form.Control
            as="select"
            value={kategoriaFilter}
            onChange={(e) => setKategoriaFilter(e.target.value)}
          >
            <option value="">--- Wybierz kategorię ---</option>
            <option value="gitary">Gitary</option>
            <option value="wokal">Wokal</option>
            <option value="instrumenty klawiszowe">Instrumenty klawiszowe</option>
            <option value="instrumenty perkusyjne">Instrumenty perkusyjne</option>
            {/* Dodaj więcej opcji kategorii według potrzeb */}
          </Form.Control>
        </Form.Group>
        <Form.Group as={Col} md="4">
          <Form.Label>&nbsp;</Form.Label>
          <div>
            <button className="btn btn-primary mr-2" onClick={filterUsers}>Filtruj</button>
            <button className="btn btn-secondary" onClick={resetFilters}>Resetuj filtry</button>
          </div>
        </Form.Group>
      </Form.Row>
      <Row>
        {filteredUsers.map((user) => (
          <Col key={user.id} md={4} style={{ marginBottom: "20px" }}>
            <UserCard user={user} />
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default WszystkieOgloszenia;
